import React from "react";
import { BrowserRouter as Router, Route, Routes, Link } from "react-router-dom";
import Signup from "./components/Signup";
import Login from "./components/Login";
import Home from "./components/tr_home"; // Import the correct Home component
import "./App.css";

function App() {
  return (
    <Router>
      <div className="App">
        <Routes>
          <Route path="/" element={<Footer />} />
          <Route path="/home" element={<Home />} />
          <Route path="/signup" element={<Signup />} />
          <Route path="/login" element={<Login />} />
          {/* Add other routes here */}
        </Routes>
        <Footer />
      </div>
    </Router>
  );
}

function Footer() {
  return (
    <div>
      <div className="bottom2">
        <Link to="/signup">SignUp</Link>
        <Link to="/login">Login</Link>
      </div>
      <p className="name">
        <span>
          <img
            id="ll"
            src="https://cdn.glitch.global/74966f89-6b4a-4631-ad79-95f11a65e0dd/logo7.jpg?v=1697534616110"
            alt="Helping Hands Logo"
          />
        </span>
        <span className="name1">Explore</span> 
        <span className="name2">Epic</span>
        <span className="name1">...</span>
      </p>
    </div>
  );
}

export default App;
